export const  navdata = [
  {
    type: nav,
    data: [
      { name: "Music", value: 1 },
      { name: "Games", value: 2 },
      { name: "Setings", value: 3 },
    ],
  },
  {
    type: nav,
    data: [
      { name: "All Music", value: 4 },
      { name: "Favourites", value: 4 },
      { name: "Last played", value: 4 },
    ],
  },
  {
    type: nav,
    data: [
      { name: "Game Settings", value: 5 },
      { name: "All Games", value: 5 },
      { name: "Pop pop", value: 5 },
    ],
  },
  {
    type: nav,
    data: [
      { name: "Sound", value: 6 },
      { name: "Display", value: 6 },
      { name: "Storage", value: 6 },
    ],
  },
  {
    type:"music"
  },
  {
    type:"game"
  },
  {
    type:"settings"
  },
];
